const getCurrentForm = (step) => {
  switch (step) {
    case 0:
      return(<EventDetails edit={isEdit} />)
    case 1:
      return (<CreateTicket edit={isEdit}/>)
    case 2:
      return (<AdditionalSettings edit={isEdit}/>)
    case 3:
      return (<PreviewTicket edit={isEdit}/>)
    case 4:
      return (<Publish edit={isEdit}/>)
    default:
      return <></>
  }
}


